import { Component } from '@angular/core';
import { CommonModule } from '@angular/common';
import { DataService } from 'src/app/services/data.service';
import AreaModel from 'src/app/models/area-mpdel';

@Component({
  selector: 'app-list',
  standalone: true,
  imports: [CommonModule],
  templateUrl: './list.component.html',
  styleUrls: ['./list.component.css']
})
export class ListComponent implements OnInit{

    public allAreas: AreaModel[];

    public constructor(private tripService:DataService, public allAreas: AreaModel[]){}

    public async ngOnInit():void{
       this.allAreas =await this.tripService.getAllAreas();
    }

}
